// src/components/TestPage.js
import React, { useState, useEffect } from "react";
import { useSearchParams } from "react-router-dom";

export default function TestPage() {
  const [searchParams] = useSearchParams();
  const totalQuestions = parseInt(searchParams.get("questions")) || 5;

  const [questions, setQuestions] = useState([]);
  const [currentIndex, setCurrentIndex] = useState(0);
  const [score, setScore] = useState(0);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [quizFinished, setQuizFinished] = useState(false);

  // ðŸ§  Sample questions (you can later fetch from MongoDB or API)
  const sampleQuestions = [
    {
      question: "What does HTML stand for?",
      options: [
        "HyperText Markup Language",
        "Home Tool Markup Language",
        "Hyperlinks and Text Markup Language",
        "Hyper Tool Multi Language",
      ],
      correct: "HyperText Markup Language",
    },
    {
      question: "Which language is used for styling web pages?",
      options: ["HTML", "JQuery", "CSS", "XML"],
      correct: "CSS",
    },
    {
      question: "Which is not a JavaScript Framework?",
      options: ["React", "Angular", "Vue", "Django"],
      correct: "Django",
    },
    {
      question: "Which is used for database management?",
      options: ["Node.js", "MongoDB", "React", "Express"],
      correct: "MongoDB",
    },
    {
      question: "Which keyword is used to declare a constant in JavaScript?",
      options: ["var", "let", "const", "static"],
      correct: "const",
    },
  ];

  // Load questions
  useEffect(() => {
    // Simulate fetching a limited number of questions
    setQuestions(sampleQuestions.slice(0, totalQuestions));
  }, [totalQuestions]);

  const handleAnswer = (option) => {
    setSelectedAnswer(option);

    // Check correctness
    if (option === questions[currentIndex].correct) {
      setScore(score + 1);
    }

    // Move to next question after short delay
    setTimeout(() => {
      if (currentIndex + 1 < questions.length) {
        setCurrentIndex(currentIndex + 1);
        setSelectedAnswer(null);
      } else {
        setQuizFinished(true);
      }
    }, 800);
  };

  // Show loading state
  if (questions.length === 0) {
    return <h3 style={styles.loading}>Loading quiz...</h3>;
  }

  // Show final score
  if (quizFinished) {
    return (
      <div style={styles.resultContainer}>
        <h2>Quiz Finished!</h2>
        <p>
          Your Score: <strong>{score}</strong> / {questions.length}
        </p>
        <button style={styles.button} onClick={() => window.location.href = "/dashboard"}>
          Back to Dashboard
        </button>
      </div>
    );
  }

  const currentQuestion = questions[currentIndex];

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2>Question {currentIndex + 1} of {questions.length}</h2>
        <p style={styles.question}>{currentQuestion.question}</p>

        <div style={styles.optionsContainer}>
          {currentQuestion.options.map((option, idx) => (
            <button
              key={idx}
              onClick={() => handleAnswer(option)}
              disabled={!!selectedAnswer}
              style={{
                ...styles.optionButton,
                backgroundColor:
                  selectedAnswer === option
                    ? option === currentQuestion.correct
                      ? "#4CAF50"
                      : "#E74C3C"
                    : "#3498DB",
              }}
            >
              {option}
            </button>
          ))}
        </div>
      </div>
    </div>
  );
}

const styles = {
  container: {
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    height: "80vh",
    backgroundColor: "#f5f5f5",
  },
  card: {
    backgroundColor: "#fff",
    padding: "30px",
    borderRadius: "12px",
    boxShadow: "0 4px 10px rgba(0,0,0,0.1)",
    width: "500px",
    textAlign: "center",
  },
  question: {
    fontSize: "18px",
    marginBottom: "20px",
  },
  optionsContainer: {
    display: "flex",
    flexDirection: "column",
    gap: "10px",
  },
  optionButton: {
    padding: "10px",
    border: "none",
    borderRadius: "5px",
    color: "#fff",
    cursor: "pointer",
    fontSize: "16px",
    transition: "background-color 0.3s ease",
  },
  resultContainer: {
    textAlign: "center",
    marginTop: "100px",
  },
  button: {
    backgroundColor: "#007BFF",
    color: "#fff",
    padding: "10px 20px",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    marginTop: "20px",
  },
  loading: {
    textAlign: "center",
    marginTop: "100px",
  },
};
